import React from 'react';
import Lood from './Lood';
import ValitudLugu from './ValitudLugu';
import './Menu.scss';


interface Lookesed {
    laulja: string;
    looPilt: any;
    looNimi: string;
}



const Menu: React.FC<Lookesed> = () => {
    const music = [
        {
            looPilt: '',
            laulja: '50 Cent',
            looNimi: 'Candy Shop'
        },
        {
            looPilt: '',
            laulja: 'Eminem',
            looNimi: 'Slim Shady'
        },
        {
            looPilt: '',
            laulja: 'Snoop Dogg',
            looNimi: 'Brownies'
        }
    ];
    
    return(
        <div className="menu">
            {/* valitud loo preview */}
            <div className="container1">
                <ValitudLugu />
            </div>
            {/* lugude list */}
            <div className="container2">
                <Lood />
            </div>
        </div>
    )
}

export default Menu;
